The University of Warwick Estates Office has a requirement for specialist Contractors to deliver the maintenance and support of the University's Building Automation and Control Systems (‘BACS’), Automatic Fire Detection System (‘Fire’), Automatic Security Control System  (‘Security’), Access Control System (‘Access Control’),
CCTV and associated systems and networks. The contract is to be awarded in 10 Lots as follows:
1. Lot 1 — Network Monitoring and Support;
2. Lot 2 — EBI Application and Systems Support;
3. Lot 3 — BACS Systems Support (Honeywell Buildings);
4. Lot 4 — BACS Systems Support (Schneider Buildings);
5. Lot 5 — Access Control and Security Systems Support (Honeywell);
6. Lot 6 — Access Control Systems Support (G4S);
7. Lot 7 — Access Control Systems Support (Salto);
8. Lot 8 — Security System Support (not FS90);
9. Lot 9 — CCTV Systems Support (terminated without award)
10. Lot 10 — Fire Detection System Support.
This may include the supply and installation of any new requirements, extensions and upgrades of new equipment at the University's discretion.

Additional information: Lot 9 - CCTV systems support was terminated without award. Upon further investigation of the procedure for Lot 9 we do not have confidence that the specification used was robust enough for a free and fair competition. In addition to this, since publication of the tender documents in August 2015, it has been deemed necessary to conduct a root and branch review of our CCTV requirement, which is likely to result in major changes to the contract requirements. Such change would require a new competition under the Public Contract Regulations. We therefore feel obliged to terminate this tender process, for Lot 9, without award.

Crown Commercial Service (the Authority) has put in place a Pan Government Collaborative Framework Agreement for use by UK public sector bodies (identified at VI.3 within the Contract Notice) which include Central Government Departments and their Arm's Length Bodies and Agencies,Non Departmental Public Bodies, NHS bodies and Local Authorities.

The Authority is seeking to establish a Framework Agreement for the provision of insurance, insurance relatedservices and compensation claims handling. The Services have been divided into the following lots:
— Lot 1 (insurance and associated support services);
— Lot 2 (insurance brokerage and associated support services);
— Lot 4 (insurance brokerage and associated support services for the Ministry of Defence (MoD)); and
— Lot 5 (compensation claims handling and associated support services).

NHSP is seeking an independent supplier to provide advice, floor planning service, scoping of fit-out requirements and oversight of works during its property selection and fit-out process for offices in the Wakefield/Leeds area.

Additional information can be found on the BravoSolution Portal. To access the RFQ please register at;

www.nhsp.bravosolution.co.uk
